import React, { useEffect, useState } from "react"

type IconProps = {
    color?: string
    size: number
}

function Icon(props: IconProps & { children: React.ReactNode }) {
    return (
        <svg
            viewBox="0 0 24 24"
            version="1.1"
            xmlns="http://www.w3.org/2000/svg"
            width={props.size}
            height={props.size}
            color={props.color}
        >
            {props.children}
        </svg>
    )
}

